import styled from "styled-components";
import { Button } from "antd";

export const ContactMeBtnWrapper = styled.div`
	.buttonBox {
		position: relative;
		float: left;
		margin: 3.5vw 0 0 3.5vw;
		width: 150px;
		cursor: pointer;
	}

	button {
		width: 100%;
		height: 60px;
		position: relative;
		background: rgba(255, 255, 255, 0.27);
		text-transform: uppercase;
		color: white;
		font-weight: 700;
		letter-spacing: 1px;
		border: none;
		font-size: 15px;
		outline: none;
		font-family: "Lucida Sans Unicode", "Lucida Grande", sans-serif;
	}
	.border {
		position: absolute;
		background: none;
		transition: all 0.5s ease-in-out;
	}

	#first > .border:nth-of-type(1) {
		top: 0;
		left: 0;
		border-left: 1px solid white;
		border-top: 1px solid white;
		width: 30px;
		height: 30px;
	}

	#first > .border:nth-of-type(2) {
		bottom: 0;
		right: 0;
		border-right: 1px solid white;
		border-bottom: 1px solid white;
		width: 30px;
		height: 30px;
	}

	#first:hover .border {
		width: 102%;
		height: 105%;
	}
`;

export const ContactMe = props => (
	<ContactMeBtnWrapper>
		<div id="first" class="buttonBox">
			<button>{props.children}</button>
			<div class="border"></div>
			<div class="border"></div>
		</div>
	</ContactMeBtnWrapper>
);
